import * as React from 'react';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Stack from '@mui/material/Stack';
import { useTheme } from '@mui/material/styles';
import Stepper from '@mui/material/Stepper';
import Step from '@mui/material/Step';
import StepLabel from '@mui/material/StepLabel';
import Typography from '@mui/material/Typography';
import {Link} from "react-router-dom";

function Survey() {
  const theme = useTheme();
  const [activeStep, setActiveStep] = React.useState(0);

  const handleNext = () => {
  setActiveStep((prevActiveStep) => prevActiveStep + 1);
  };

  const handleBack = () => {
  setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  const steps = ['brandName', 'brandNameMean', 'business', 'vibe', 'select'];

    const renderStep = () => {
      let content = null;
      switch (activeStep) {
          case 0:
            content = (
              <div className="p-lr-8">
                  <h1 className="m-b-0">브랜드명</h1>
                  <span className="description-span">CI /BI 에 적용될 브랜드명 또는 서비스명을 입력해주세요.</span>
                  <Box
                      component="form"
                      noValidate
                      autoComplete="off">
                      <TextField required id="outlined-required" label="브랜드명 입력" />
                  </Box>
              </div>
            );
            break;
          case 1:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="브랜드명 의미 입력" variant="standard" />
                    </Box>
                  </Stack>
                </div>
              );
            break;
          case 2:
            content = (
              <div className="p-lr-8">
                  <Stack direction="row">
                  <Box
                    component="form"
                    sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                    noValidate
                    autoComplete="off">
                    <TextField id="standard-basic" label="관련 비즈니스 입력" variant="standard" />
                  </Box>
                </Stack>
              </div>
            );
          break;
          case 3:
              content = (
                <div className="p-lr-8">
                    <Stack direction="row">
                    <Box
                      component="form"
                      sx={{ '& > :not(style)': { m: 1, width: '30ch' } }}
                      noValidate
                      autoComplete="off">
                      <TextField id="standard-basic" label="원하는 로고 분위기" variant="standard" />
                    </Box>
                  </Stack>
                </div>
              );
            break;
          case 4:
            content = (
              <div className="p-8">
                <div className="m-8">원하는 스타일을 선택해주세요!</div>
                  <Stack direction="row">
                </Stack>
              </div>
            );
          break;
        default:
          content = <div>Error</div>;
          break;
      }
      return content;
    };

  return (
      <div className="parent">
          <div className="child">
              <div className="survey text-center">
                  <div className="progress-div">
                      <Stepper activeStep={activeStep}>
                          {steps.map((label, index) => {
                              const stepProps = {};
                              const labelProps = {};
                              return (
                                  <Step key={label} {...stepProps}>
                                      <StepLabel {...labelProps}></StepLabel>
                                  </Step>
                              );
                          })}
                      </Stepper>
                  </div>
                  <div className="content-div text-left">
                      {activeStep === steps.length ? (
                          <React.Fragment>
                              생성중이에요, 잠시만 기다려주세요 !
                          </React.Fragment>
                      ) : (
                          <React.Fragment>
                              <Typography sx={{ mt: 2, mb: 1 }}>{renderStep()}</Typography>
                          </React.Fragment>
                      )}
                  </div>
                  <div className="button-div">
                      {activeStep < steps.length ? (
                          <Box sx={{ display: 'flex', flexDirection: 'row', pt: 2 }}>
                              <Button
                                  className="startBt f-right" variant="contained"
                                  disabled={activeStep === 0}
                                  onClick={handleBack}
                                  sx={{ mr: 1 }}
                              >
                                  BACK
                              </Button>
                              <Box sx={{ flex: '1 1 auto' }} />
                              <Button className="startBt f-right" variant="contained" color="pupleblue" onClick={handleNext}>
                                  {activeStep === steps.length - 1 ? 'FINISH' : 'NEXT'}
                              </Button>
                          </Box>
                      ) : (
                          <Box></Box>
                      )}
                  </div>
              </div>
          </div>
      </div>
  );
}

export default Survey;
